import React from 'react';
import { AppBar, Toolbar, ListItem,
  IconButton,
  ListItemText,
  Avatar,
  Divider,
  List,
  Typography,
  Box
} from "@material-ui/core";
import { 
  ArrowBack,
  AssignmentInd,
  Home,
  Apps,
  ContactMail
} from "@material-ui/icons";
import avatar from "../avatar.png"
import { makeStyles } from '@material-ui/core/styles';




const Navbar = () => {
  return (
    <>
      <Box component="div">
        <Avatar src={avatar} alt="Akhila"/>
      </Box>
      <Box component="nav">
        <AppBar position="static">
          <Toolbar>
            <IconButton>
              <ArrowBack />
            </IconButton>
            <Typography variant="h5">
              Portfolio
            </Typography>
          </Toolbar>
        </AppBar>
      </Box>
    </>
  )
}

export default Navbar;
